import React from "react";

interface GraphButtonProps {
	show: boolean,
	setShow: (show: boolean) => void,
}

const GraphButton: React.FC = ({ show, setShow }) => {
	const name = show ? "Show Graph" : "Hide Graph";

	return (
		<div>
			<button className="control-button" onClick={() => setShow(!show)}>
				{ name }
			</button>
		</div>
	);
}

export default GraphButton;
